import React, {useState} from "react";

import "./Modal.css"
export const Modal = ({closeModal}) => {
    const [formState, setFormState] = useState({
        czynnosc: "",
        czas_trwania: "",
        nastepstwoL: "",
        nastepstwoP: "",
    });
    return(
        <div className="modal-container" onClick={(e)=>{
                if(e.target.className === "modal-container") closeModal();
            }}
        >
            <div className="modal">
                <form>
                    <div className="form-group">
                        <label htmlFor="czynnosc">Czynnosc</label>
                        <input name="czynnosc" value={formState.czynnosc}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="czas">Czas trwania</label>
                        <input name="czas" value={formState.czas_trwania}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="nastepstwoL">Następstwo L</label>
                        <input name="nastepstwoL" value={formState.nastepstwoL}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="nastepstwoP">Następstwo P</label>
                        <input name="nastepstwoP" value={formState.nastepstwoP}/>
                    </div>
                    <button type="submit" className="btn">Wprowadz</button>
                </form>
            </div>
        </div>
    )
}
